import './error.css';
import React from "react";
import {Link,useParams} from "react-router-dom";

function ErrorMessage() {

  let { message } = useParams();

  return (


      <main className='container top1'>

          <div className='row'>
              <Link to='/' className='col-12'><i class="fas fa-caret-left"></i></Link>
          </div>

          <div className='row'>          
            <div className='col-12 centre top1'>
                  <p className='green'><b>{message}</b></p>
            </div>
            <a href ='http://localhost:3000/'>
                 <button className='col-12'><b>OK</b></button> 
            </a>
          </div>

      </main>    
  );
}

export default ErrorMessage;
